description:
Star Wars: Episode V - The Empire Strikes Back (1980)

Verenigde Staten
Science-Fiction / Fantasy
124 minuten / 129 minuten (special edition)

geregisseerd door Irvin Kershner
met Mark Hamill, Carrie Fisher en Harrison Ford

Darth Vader zet zich in om de rebellie tegen Het Keizerrijk de kop in te drukken. De 
rebellen hebben een basis op de ijsplaneet Hoth. Wanneer keizerlijke troepen arriveren 
om de rebellen te vernietigen vluchten Han Solo en Princess Leia naar Cloud City, waar 
ze gevangen worden genomen door Vader. Luke Skywalker reist af naar de planeet Dagobah, 
waar hij door de Jedi-meester Yoda in de Force getraind wordt.
